import React, { Component } from 'react';
import './TestFlex.css';

class TestFlex extends Component {
    render() {
        return(
            <div className='wrap'>
                <div className='left'></div>
                <div className='right'></div>
            </div> 
        )

    }
}

export default TestFlex;
